import React, { Component } from 'react'

import './header.css'

export default class Header extends Component {
  render() {
    return (
      <div>
        <div className="header-bar">
          <a href="/#">首页</a>
          <a href="/#">教学管理</a>
          <a href="/#">学习</a>
          <a href="/#">资源超市</a>
          <a href="/#">教育应用</a>
          <a href="/#">新闻</a>
          <a href="/#">名师名校</a>
        </div>
      </div>
    )
  }
}
